// src/componentes/elementos/Carrito.js
const Carrito = ({ items }) => (
  <div className="catalogo-carrito">
    <h3>Carrito</h3>
    <ul>
      {items.map((item, index) => (
        <li key={index}>{item.nombre} - ${item.precio}</li>
      ))}
    </ul>
  </div>
);

export default Carrito;
